import React from "react";
import ReactDom from "react-dom";
import Heading from "./Heading";

ReactDom.render(
  <>
    <Heading />
    
    <ol>
      <li>Roheel</li>
      <li>Islam</li>
      <li>Roheel</li>
      <li>Roheel Technical</li>
    </ol>
  </>,

  document.getElementById("root")
);
